import React from 'react';
import { Breadcrumb, BreadcrumbItem } from 'reactstrap';
import { Link } from 'react-router-dom';

function Create(props) {
    return (
        <div className="container">
            <div className="row">
                <div className="col">
                    <h2>Create New Account</h2>
                    <hr />
                </div>
            </div>
        </div>
    );
}

export default Create;
